import React, { Component } from 'react';
import { Link } from "react-router-dom";
  import { InputGroup, InputGroupAddon, InputGroupText, Input , Form, FormGroup,Button } from 'reactstrap';
  import { faSearch } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { NONAME } from 'dns';
  






  export default class Footer extends React.Component {    
    render() {
      return (
        <div className="footer">
           <h2>مدرستي</h2>
             <p>التعليم  هو موقع لتعليم  المراحل الدراسية الابتدائية والاعداديه 
               للغة العربية بكل مجالاتها 
                مثل: القراءة , النصوص , والنحو</p>
            <Link to="/">الصفحه الرئسيه</Link>{'  '}
            <Link to="/learn">المنهج </Link>{'  '}
            <Link to="/contact"> تواصل معنا</Link>{'  '}
            <Form >    
            <InputGroup>
              <Input placeholder="ابحث عن الدرس..." />
              <InputGroupAddon addonType="append">
                <InputGroupText><FontAwesomeIcon icon={faSearch}></FontAwesomeIcon> </InputGroupText>
              </InputGroupAddon>
             </InputGroup>
           </Form>
              
        </div>
      );
    }
  }
